const Search = props => (
    <div>
        <input type="text" className="searchBar" placeholder="Search"></input>
          
  
      <style jsx>{`
        .searchBar{
          background-color: white;
          height: 20px;
          padding-left: 5px;
          width: calc(100% - 22px);
          border-radius: 100px;
          border: none;
        }
        .searchBar:hover {
          background: black;
          color: white;
        }
      `}
      </style>
    </div>
  );
  
  export default Search;
